import React from "react";
import Input from "./Input";


const currentTime = new Date().getHours();

function Greatings() {
    if (currentTime < 12) {
        return "Good Morning!";
    } else {
        return "Good afternoon!";
    }
}
const isLoggedIn = true ? <h1>Hello</h1> :  <Input />;
function Login() {
    return (
        <div className="container">
            {Greatings()}
            {isLoggedIn} 
        </div>
    )
}
export default Login;
